import React from 'react';

const DropDown = () => {
    const options = [
        { label: 'Red', value: 'red' },
        { label: 'Yellow', value: 'yellow' },
        { label: 'Green', value: 'green' }
    ]
    const list = options.map((color) => <div className='button r-5 p-10 mb-1 bg-neogreen'>{color.label}</div>)
    return (
        <div className='white'>
            { list }
        </div>
    )
}
export default DropDown;
